import styled from "styled-components";

const DashboardStyled = styled.section`
  main {
    background-color: #f7f8fc;
    height: auto;
    width: 100vw;
    display: flex;
    justify-content: center;
    align-items: center;
  }

  .div-form {
    background-color: #fff;
    border-radius: 5px;
    border: #c5c7cd solid 1px;
    height: auto;
    width: 97vw;
    margin-top: 8px;
    margin-left: -10px;
    margin-bottom: 8px;
    display: flex;
    justify-content: center;
  }

  .posicao-form {
    width: 50vw;
    margin-top: 29px;
  }
`;

export default DashboardStyled;
